import React, { useState } from 'react';
import Link from '@material-ui/core/Link';
import { makeStyles } from '@material-ui/core/styles';
import Typography from '@material-ui/core/Typography';
import Title from './Title';
import $ from "jquery";




export default class Deposits extends React.Component{
    constructor() {
        super();
        this.state = {
            data: this.createData()
        }
    }

    createData() {
        let data = []
        let i = 0;
        for( i ; i < 194; i++){
            data.push({IBC_prediction: 0})
        }
     return data;
    }

     componentDidMount() {
        this.update()
    }

    update(){
       $.get("api/deposit", (data) =>{
            console.log(data)
            this.setState({data: data})
       })
    }

    render() {

       return (
    <React.Fragment>
        <div>
            <Title>Recent Prediction</Title>
            <Typography component="p" variant="h4">
                {this.state.data[0].IBC_prediction}
            </Typography>
            <Typography color="textSecondary" >
               on {this.state.data[0].time}
            </Typography>
            <Typography color = "textSecondary" variant={"subtitle1"}>
               Model: {this.state.data[0].model}
            </Typography>
        </div>
        <br></br>
      <div>
        <Link color="primary" href="/vis" >
          View More
        </Link>
      </div>
    </React.Fragment>
  );
    }
}
